import React from 'react';
import { 
    ModalPage,
    ModalPageHeader,
    Header,
    Div,

  } from '@vkontakte/vkui';

import Icon24Dismiss              from '@vkontakte/icons/dist/24/dismiss';


export default class Donut extends React.Component {
    render() {
        return (
            <ModalPage
                id={this.props.id}
                onClose={this.props.onClose}
                header={
                  <ModalPageHeader
                  right={<Header onClick={this.props.onClose}><Icon24Dismiss /></Header>}
                  >
                    Комментарий
                  </ModalPageHeader>
                }
                >
                  <Div>
                    <div style={{whiteSpace: "pre-wrap"}}>{this.props.comment}</div>
                  </Div>
            </ModalPage>
        )
    }
}
